export default {
  name: "Register",

  data() {
    return {
      phone: "",
      code: "",
      password: "",
      password1: "",
      agree: true
    };
  },

  methods: {
    async getCode() {
      try {
        await this.$store.dispatch("getCode", this.phone);
        this.code = this.$store.state.user.getCode;
      } catch (error) {}
    },

    async userRegister() {
      const success = await this.$validator.validateAll();

      if (success) {
        try {
          const {
            phone,
            code,
            password,
            password1
          } = this;
          phone && code && password == password1 && (await this.$store.dispatch("userRegister", {
            phone,
            code,
            password
          }));
          this.$router.push("/login");
        } catch (error) {}
      }
    }

  }
};
